import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 20, height: 20, viewBox: "0 0 20 20", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M3 3a1 1 0 000 2v6a3 3 0 003 3h3.5v2h-2a.5.5 0 000 1h5a.5.5 0 000-1h-2v-2H14a3 3 0 003-3V5a1 1 0 100-2H3zm1 2h12v6a2 2 0 01-2 2H6a2 2 0 01-2-2V5z", fill: primaryFill }));
};
const ProjectionScreen20Regular = wrapIcon(rawSvg({}), 'ProjectionScreen20Regular');
export default ProjectionScreen20Regular;
